    <div className="App">
      <header className="App-header">

        <div class="container">
         <div>
          <label>Username</label>
          <input type="text" value={person.name}/>
         </div>
         <div>
          <label>Password</label>
          <input type="password" value={person.name}/>
         </div>
        </div>
        <h1>Hello {person.name} you'r {person.age} year old.</h1>

      </header>
    </div>
  );
}

export default App;
